function getPriceinUSD() public view returns (uint256) {
    // Uniswap V2 pair for USDT/WETH
    address USDT_WETH_PAIR = 0x0d4a11d5EEaaC28EC3F61d100daF4d40471f1852;
    IERC20 USDT            = IERC20(0xdAC17F958D2ee523a2206206994597C13D831ec7);
    IERC20 WETH            = IERC20(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);

    // Uniswap V2 pair for TOKEN/WETH (the staking-token pair)
    address TOKEN_WETH_PAIR = 0x3Ac4B2C0cBb85d309f1a7D0410e8E10594e5c928;
    IERC20 STAKE_TOKEN      = IERC20(0xE1223F2d494c37f83E1BDda5015E990938f00d81);

    // Step 1: ETH price in USDT from the USDT/WETH pair
    uint256 usdtReserve = USDT.balanceOf(USDT_WETH_PAIR);
    uint256 wethReserve = WETH.balanceOf(USDT_WETH_PAIR);

    require(wethReserve > 0, "SafeMath: division by zero");
    uint256 ethPriceInUSDT = (usdtReserve * 1e18) / wethReserve; // scaled by 1e18

    // Step 2: TOKEN price in WETH from the TOKEN/WETH pair
    uint256 wethInTokenPair   = WETH.balanceOf(TOKEN_WETH_PAIR);
    uint256 tokenInTokenPair  = STAKE_TOKEN.balanceOf(TOKEN_WETH_PAIR);

    require(tokenInTokenPair > 0, "SafeMath: division by zero");
    uint256 tokenPriceInWETH = (wethInTokenPair * 1e9) / tokenInTokenPair; // scaled by 1e9

    // Step 3: TOKEN price in USDT
    uint256 tokenPriceInUSDT = (tokenPriceInWETH * ethPriceInUSDT) / 1e18;

    return tokenPriceInUSDT;
}

